import React, {Component} from 'react';
import {Link} from 'react-router-dom';
import Navbar from './Layout/Navbar';
import Signin from './Layout/auth/Signin'

class Landingpage extends Component {
	render() {
 		return (
  			<BrowserRouter>
    			<div>
    				<Navbar />
    				<Signin />
    				
    			</div>
    		</BrowserRouter>
    
  		);
	}
}

export default Landingpage;
